import { Link } from "react-router-dom";
import style from "./Landing.module.css";

const Landing = () =>{
    return(
        <div className={style.Landing}>
            <Link to="/home"> 
                <p>S T A R T</p>
            </Link>
            <h1>Este es el Landing</h1>
        </div>
    )
};

export default Landing;
